import styled from 'styled-components/macro';

export const Header = styled.div`
    display: flex;
    margin-bottom: 1em;
    align-items: center;
`;

export const Title = styled.h2`
    font-size: 24px;
`;

export const ButtonWrap = styled.div`
    margin-left: auto;
`;
